(function(){'use strict';angular.module('app.organization').factory('OrganizationFactory',OrganizationFactory).controller('OrganizationListController',organizationListController);organizationListController.$inject=['organization','OrganizationFactory','deleteOrganizationModal'];function organizationListController(organization,OrganizationFactory,deleteOrganizationModal){var vm=this;vm.delete=deleteOrganizationModal.getDeleteMethod(vm.organization);}OrganizationFactory.$inject=['$http','$stateParams','AuthTokenFactory','UserFactory'];function OrganizationFactory($http,$stateParams,AuthTokenFactory,UserFactory){'use strict';var vm=this;vm.getOrganization=getOrganization;return{getOrganization:getOrganization};function getOrganization(){if(AuthTokenFactory.getToken()){return $http.get('/api/v1/organization/'+$stateParams.id).then(function success(response){return response;});}else{console.log('no auth token');}}};})();